  [],\n\t\"revision_timestamp\": \"2016-07-27T23:00:23.448864\",\n\t\"name\": \"papahanaumokuakea-sandbur-eradication-at-french-frigate-shoals-the-sequel\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Sandbur is an aggressive annual grass that
  poses a serious threat to seabird and sea turtle nesting habitat within Papahanaumokuakea
  Marine National Monument. Because of this threat, it is a Monument-widepriority
  for eradication and major efforts were undertaken to eliminate the plant from Tern
  and East Islands within French Frigate Shoals in the early 1990u2019s. Efforts were
  considered successful and post-treatment monitoring continued until 1998. No plants
  had been found on either island since 1996. In the winter of 2011, following a summer
  of the highest level of green sea turtle nesting activity on East Island ever recorded
  in 39 years of continuous monitoring, sandbur was again observed on East Island.
  Whether a long-dormant seed bank of the grass was released by the record-breaking
  extent of turtle digging or the grass was reintroduced by humans in recent history
  remains unknown and, for our purposes, unimportant. Re-eradication is an especially
  high priority because East Island provides critical nesting habitat for over 90%
  of the entire population of Hawaiian green sea turtles (Chelonia mydas) as well
  as several seabird species. At the time the grass was discovered, the field station,
  which is based on Tern Island seven miles away, lacked any functional outboard motors.
  Rapid response was therefore impossible. Grant funds were primarily used to purchase
  a new outboard motor in order to leverage existing volunteer resources and resume
  sandbur eradication efforts on East Island.\",\n\t\"license_title\": \"License Not
